- 2 t. 1 (Lợn cái) đã đẻ nhiều lứa. Lợn sề*. Nái sề*. 2 (thgt.). (Đàn bà) đã sinh đẻ nhiều lần, thân thể không còn gọn gàng. Mẹ sề. Gái sề.

